import { configureStore } from '@reduxjs/toolkit';
import userReducer from './userSlice';
import inforReducer from "../features/container/dangnhap/dangnhapSlice"
const rootReducer = {
  infor: inforReducer,
}

export default configureStore({
  reducer: rootReducer
});
